const Contact = () => {
   return <div>
      <p style={{width: '90%', height: 'fit-content', padding: '10px 20px', background: 'rgb(5, 94, 26)', color: 'white', textAlign: 'center', boxShadow: 'rgba(7, 79, 42, 0.4) -5px 5px, rgba(7, 79, 42, 0.3) -10px 10px, rgba(7, 79, 42, 0.2) -15px 15px, rgba(7, 79, 42, 0.1) -20px 20px, rgba(7, 79, 42, 0.05) -25px 25px'}}> Feel free to contact me for any purpose between <br /> <span> 8.00 am </span> to <span> 10.00 pm </span></p>
   </div>
}

export default Contact
